def build_llm_prompt(product_page_content):
    return f"""
Step 1. Product & Competitor Review.
Product Understanding: Carefully review the product and brand identity and 
understand its key features, materials, target audience, and tone of voice.using this html content:
{product_page_content}
    """.strip()

def get_product_page_content(url: str, tries: int = 3, timeout: int = 20) -> Optional[str]:
    for i in range(tries):
        try:
            resp = requests.get(url, headers=HEADERS, timeout=timeout)
            print(resp)
            if resp.status_code == 200 and "<html" in resp.text.lower():
                return resp.text
        except Exception:
            pass
    return None

def safe_json_loads(text: str):
    """
    Attempts to parse JSON from a model's text output robustly.
    - Extracts the first valid {...} block.
    - Cleans Markdown code fences and single quotes.
    """
    if not text:
        raise ValueError("Empty LLM response")

    # Remove code fences like ```json ... ```
    text = re.sub(r"^```(?:json)?|```$", "", text.strip(), flags=re.M)

    # Try direct parse first
    try:
        return json.loads(text)
    except json.JSONDecodeError:
        pass

    # Try extracting the JSON object portion
    match = re.search(r"\{[\s\S]*\}", text)
    if match:
        candidate = match.group(0)
        # Replace single quotes with double quotes (naively but works well for small texts)
        candidate = candidate.replace("'", '"')
        try:
            return json.loads(candidate)
        except json.JSONDecodeError:
            pass

    raise ValueError("Could not parse JSON from model output:\n" + text[:500])

def call_llm(prompt: str, model: str = DEFAULT_OPENAI_MODEL) -> Dict[str, Any]:
    resp = client.chat.completions.create(
        model=model,
        temperature=1,
        messages=[
            {"role": "system", "content": system_message},
            {"role": "user", "content": prompt}
        ]
    )
    print(resp)
    content = resp.choices[0].message.content
    try:
        return safe_json_loads(content)
    except json.JSONDecodeError:
        m = re.search(r"\{.*\}\s*$", content, flags=re.S)
        if not m:
            raise
        return json.loads(m.group(0))

